import {RouterProvider, createBrowserRouter} from "react-router-dom"

import Root       from "./pages/Root";
import Home       from "./pages/Home";
import EditEvent  from "./pages/EditEvent";
import EventsRoot from "./pages/EventsRoot";
import Error      from "./pages/Error";
import Events,      {loader as eventsLoader} from "./pages/Events";
import EventDetails,{loader as eventDetails, action as deleteEventAction} from "./pages/EventDetails";
import NewEvent from "./pages/NewEvent";


const router = createBrowserRouter([
    { path: "/", element: <Root/>, errorElement: <Error />,children:[
        { index: true, element: <Home/>},
        { path: "events", element: <EventsRoot />, children: [
            { index: true,  element: < Events/>, loader: eventsLoader},
            { path: ":eventId", id:"event-detail",loader: eventDetails, children: [
                { index: true,  element: < EventDetails/>, action: deleteEventAction},
                { path: "edit", element: < EditEvent/>},
            ]},
            { path: "new", element: < NewEvent/>, action: newEventAction}
        ]}
    ]}
]);

function App() {
  return <RouterProvider router={router}/>;
}

export default App;
